Pydantic allows you to specify and validate your data model using intuitive type-annotated classes. It’s super fast and is a foundation of FastAPI web framework (request/response models and validations). from typing import List, Optional from fastapi import FastAPI
from pydantic import BaseModel app = FastAPI() class Item(BaseModel): name: str tax: Optional[float] = None tags: List[str] = [] @app.post("/items/", response_model=Item)
async def create_item(item: Item): return item You get request and response validation for free.
